#include <bits/stdc++.h>
using namespace std;
string solve(string s)
{
    stack<char> c;
    for (int i = 0; i < s.length(); i++) {
        if (c.empty()) {
             c.push(s[i]);
        }
        else if ((c.top() == '(' && s[i] == ')')
                 || (c.top() == '{' && s[i] == '}')
                 || (c.top() == '[' && s[i] == ']')) {
            c.pop();
        }
        else {
            c.push(s[i]);
        }
    }
    if (c.empty()) {
        return "TRUE";
    }
    return "FALSE";
}

signed main() {
    ios_base::sync_with_stdio( false );
    cin.tie(NULL);
    cout.tie(NULL);
    string a, b = "";
    while (cin >> a)
    {
        for (int i = 0; i < a.size(); i++) {
            if (a[i] == '{' or a[i] == '}' or a[i] == '(' or a[i] == ')' or a[i] == '[' or a[i] == ']') {
                b += a[i];
            }
        }
    }
    cout << solve(b);

    return 0;
}
